import React, { useContext } from 'react';
import Switch from 'react-switch';
import { ThemeContext } from 'styled-components';

import { ContainerProjects, SubContainerProjects, Divider, SubTitle, SubTitleColor, ContainerButtons } from './styles';
import { FiArrowRight, FiArrowLeft } from "react-icons/fi";
interface Props {
    toggleTheme(): void;
}

const Projects: React.FC<Props> = ({ toggleTheme }) => {
    const { colors, title } = useContext(ThemeContext);

    return (
        <ContainerProjects id="projects">
            <SubContainerProjects>
                <Divider />
                <SubTitle>
                    Meus projetos
                    <SubTitleColor> pessoais</SubTitleColor>
                </SubTitle>
            </SubContainerProjects>

            <ContainerButtons>
                <ButtonArrows>
                    <FiArrowRight color='#37D892' size={25} />
                </ButtonArrows>
                <ButtonArrows>
                    <FiArrowRight color='#37D892' size={25} />
                </ButtonArrows>
            </ContainerButtons>
        </ContainerProjects>
    );
}

export default Projects;
